import logo from './logo.svg';
import './App.css';
import {useState} from 'react'; 
import {Routes, Route, Link, useNavigate} from 'react-router-dom';
import data from './data';
import data2 from './data2';
import data3 from './data3';
import data4 from './data4';
import chiefdata from './chiefdata';
import MainShowCase from './component/MainShowCase';
import Detail from './component/Detail';
import Cart from './component/Cart';
import Footer from './component/Footer';
import { useEffect } from 'react';



function App() {
  useEffect(()=>{
    if(localStorage.getItem('watched') == null){
      localStorage.setItem('watched', JSON.stringify([ ]))
    }
  },[]);

  let [pang, setPang] = useState(data);
  let [pang2,setPang2] = useState(data2);
  let [pang3,setPann3] = useState(data3);
  let [pang4,setPang4] = useState(data4);
  let [chief,setChief] = useState(chiefdata);
  let navigate = useNavigate();

  const scrollToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: 'smooth'
  })}

  return (
    <div>
      <div className='quick'>
        <img className='sign' src={process.env.PUBLIC_URL + '/call.png'} />
      </div>
      <div className='quick2' onClick={()=>{ 
          scrollToTop();
          navigate("/cart")
        }}>
        <img className='sign2' src={process.env.PUBLIC_URL + '/shopping-bag.png'} />
      </div>
      <div className="navContainer">
        <div className='innerNav'>
          <p className="home" onClick={()=>{navigate("/")}}>Un Bouquet De Lavande</p>
          <ul>
            <li>로그인</li>
            <Link className='menuList' to="/cart"><li>장바구니</li></Link>
          </ul>
          <div className='iconArea'>
            <img className='logIn' src={process.env.PUBLIC_URL + '/avatar.png'}/>
            <Link to="/cart"><img className="cartIcon" src={process.env.PUBLIC_URL + "/cart.png"}/></Link>
          </div>
        </div>
      </div>
      <div className="main-bg"></div>
      <Routes>
        <Route path="/" element={<div><MainShowCase pang={pang} pang2={pang2} pang3={pang3} pang4={pang4} setPang={setPang} /></div>} />
        <Route path="/detail/:id" element={<div><Detail pang={pang} pang2={pang2} pang3={pang3} pang4={pang4} setPang={setPang} chief={chief} /></div>} />
        <Route path="/cart" element={<div><Cart/></div>} />
        <Route path="*" element={<div className='page404'><h3>해당 페이지를 찾을 수 없습니다.</h3></div>}/>
      </Routes>
      <div className='event'>
        <h2>진행중인 이벤트</h2>
        <img src={process.env.PUBLIC_URL + "/event.png"}/>
      </div>
      <div className="announcement">
        <h2>공지사항</h2>
        <ul>
          <li><p>네이버페이 제휴 포인트 적립서비스 안내</p> <span>2022–09-25</span></li>
          <li><p>KTX특송 배송제한으로 인한 배송불가지역 안내</p> <span>2022–09-02</span></li>
          <li><p>코레일 수화물센터 파업으로 인한 긴급안내</p> <span>2022-09-23</span></li>
          <li><p>순우유케이크 가격 인상안내</p> <span>2022-08-28</span></li>
          <li><p>상반기 배송 이벤트 당첨자 발표</p> <span>2022-08-25</span></li>
          <li><p>용인 수화물센터 운영종료 및 변경</p> <span>2022-07-14</span></li>
          <li><p>KTX특송 이용 및 수화물센터 운영종료 및 갱신</p> <span>2022-06-10</span></li>
          <li><p>배송시간 및 추가 배송불가지역 안내</p> <span>2022-06-08</span></li>
        </ul>
      </div>

      <Footer />
    </div>
  );
}

export default App;
